    <div class="wrap" role="img" aria-label="Ð—Ð°ÑÑ‚Ð°Ð²ÐºÐ°: Stay tuned, BRB!">
        <div class="bg" aria-hidden="true"></div>
        <div class="shade" aria-hidden="true"></div>
        <div id="t">10:00</div>
    </div>
    <script>
        (function () {
            function q(name, d) {
                const v = new URLSearchParams(location.search).get(name);
                const n = parseInt(v, 10);
                return Number.isFinite(n) && n >= 0 ? n : d;
            }
            function fmt(s) {
                const m = ("" + Math.floor(s / 60)).padStart(2, "0");
                const r = ("" + (s % 60)).padStart(2, "0");
                return m + ":" + r;
            }
            var left = q("t", 600),
                el = document.getElementById("t");
            el.textContent = fmt(left);
            var id = setInterval(function () {
                left -= 1;
                if (left <= 0) {
                    left = 0;
                    clearInterval(id);
                    console.log("Time's up!");
                    let voice = "TIME TIME TIME COME HERE!";
                    let x = new SpeechSynthesisUtterance(voice);
                    x.language = "en-US";
                    x.rate = 2;
                    x.pitch = 2;
                    x.voice = speechSynthesis
                        .getVoices()
                        .find((v) => v.lang === "en-US");
                    speechSynthesis.speak(x);
                }
                el.textContent = fmt(left);
            }, 1000);
        })();
    </script>
